import './Header.css';  

function Header() {
    return (
    <div class = 'headerBody' >
        <img src='Icons/home.png' alt='Home Icon' />
        <p>Hakkımızda</p>
        <h1>UniScore</h1>
        <p>İletişim</p>
        <img src='Icons/account.png' alt='Account Icon'/>

        <select name="example">
  <option value="A">A</option>
  <option value="B">B</option>
  <option value="-">Other</option>
</select>
    </div>
  );    
}
export default Header;
